import SideBar from "../attendanceTime/sideBar/SideBar";
import classes from "./adminHome.module.css";

const Home = () => {
  return (
    <div className={classes.main}>
      <SideBar />
      <div className={classes.image}></div>
    </div>
  );
};

export default Home;
